import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <div>
        <p>&copy; 2024 Ofertas Afiliados. Todos os direitos reservados.</p>
        <p>Site desenvolvido para gerenciamento de produtos em oferta</p>
      </div>
    </footer>
  );
};

export default Footer;
